import React from "react";
import MainPage from "./components/mainPage";

import {
  Redirect,
  BrowserRouter as Router,
  Route,
  Switch,
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
        <Route exac path="/:id">
          <MainPage />
        </Route>
        <Route exac path="/">
          <MainPage />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
